import React from 'react';
import { RouterProvider } from '@tanstack/react-router';
import { router } from './router';  // Zaimportowanie konfiguracji routera

function App() {
  return (
    <div className="App">
      <RouterProvider router={router} />
    </div>
  );
}

export default App;
